import React, { Component } from 'react';

import { todos } from '../todos.json';
console.log(todos);

class Navigation extends Component {
    render() {
        return (
            <div className="col-6 mx-auto mt-5">
                <p className="text">
                    { this.props.titulo }
                </p>
            </div>
        )
    }
}

export default Navigation;
